import React, { Component } from 'react';
import Article from './Article';

class ArticleArray extends Component {

    constructor(props){
        super(props)
    }

    shouldComponentUpdate(){
        return true;
    }

    componentWillReceiveProps(){
        console.log('ArticleArray컴포넌트에서 받았다')
        console.log(this.props.articles)
    }

    deleteArticle = ( article) => {
        this.props.callBack(article);
    }

    render() {
        return (
            <div>
                {this.props.articles.map(
                    article => (<Article key={article.articleID} article={article} callBack={this.deleteArticle} />)
                )}
            </div>
        );
    }
}

export default ArticleArray
